class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: Double = 0.70

    init(images: [UIImage], iconScale: Double = 0.70) {
        self.images = images
        self.iconScale = iconScale
    }

    func stackImages() -> UIImage {
        let newWidth = images.reduce(0) { max($0, $1.size.width) }
        let iconsSize = floor(newWidth * iconScale).rounded(.down)
        let iconsInset = (newWidth - iconsSize) - 1

        let stackedImage = UIImage.createEmptyImage(size: CGSize(width: newWidth, height: newWidth))

        for (index, image) in images.enumerated() {
            let scaledImage = image.scaled(to: CGSize(width: iconsSize, height: iconsSize))
            let inset = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            let insetRect = inset.offsetBy(dx: CGFloat(index == 0 ? iconsInset : 0), dy: CGFloat(index == 1 ? iconsInset : 0))
            stackedImage.draw(in: insetRect, blendMode: .normal, alpha: 1.0)
            scaledImage.draw(in: insetRect, blendMode: .normal, alpha: 1.0)
        }

        return stackedImage
    }
}
```

